using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct CooldownComponentResolver : IResolver<CooldownComponent>, IResolver<CooldownComponentResolver,CooldownComponent>, IData	{		public CooldownComponentResolver In(ref CooldownComponent cooldowncomponent)		{			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<CooldownComponent>();			Out(ref local);		}		public void Out(ref CooldownComponent cooldowncomponent)		{		}	}}